import { Component, OnInit, Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Component({
  selector: 'recent-tacos',
  templateUrl: 'recents.component.html',
  styleUrls: ['./recents.component.css']
})

@Injectable()
export class RecentTacosComponent implements OnInit {
  recentTacos: any;

  constructor(private httpClient: HttpClient) { }

  ngOnInit() {
    this.httpClient.get('http://localhost:8080/design/recent') // <1>
        .subscribe(data => this.recentTacos = data);
  }
}
<cloud-title>Admire some recently created taco masterpieces</cloud-title>

<p>Even the greatest artists sometimes need to be inspired by the works of others.
  Here are some of the most recently created tacos, designed by taco artists just like you...</p>

<div class="recentsblock">
  <div class="tacoblock" *ngFor="let taco of recentTacos">
      <div class="tacoName"><span class="small">The</span><br/>"{{taco.name}}"</div>
      <div class="tacoDesc">
        <ul class="commalist">
          <li *ngFor="let ingredient of taco.ingredients | nonwraps">{{ingredient.name}}</li>
        </ul>
        <div *ngIf="(taco.ingredients | wraps)?.length > 0">
        <span>wrapped in</span><ul class="commalist">
            <li *ngFor="let ingredient of taco.ingredients | wraps">{{ingredient.name}}</li>
        </ul>
        </div>
        <div *ngIf="(taco.ingredients | wraps)?.length == 0">in a bowl</div>
      </div>
      <little-button label="Order this taco"></little-button>
  </div>
</div>
